#include <iostream>
#include <easy/profiler.h>
#include <ros/package.h>

void magenta_func()
{
    EASY_FUNCTION(profiler::colors::Magenta);
}

int main(int argc, char** argv){
    std::cout << "EASY_PROFILER" << std::endl;

    EASY_PROFILER_ENABLE;

    magenta_func();

    EASY_BLOCK("Calculating sum");
    int sum = 0;
    for (int i = 0; i < 10; ++i) {
        EASY_BLOCK("Addition", profiler::colors::Red);
        sum += i;
    }
    EASY_END_BLOCK;

    EASY_BLOCK("Calculating multiplication", profiler::colors::Blue500);
    int mul = 1;
    for (int i = 1; i < 11; ++i)
        mul *= i;
    EASY_END_BLOCK;

    std::string path = ros::package::getPath("roscpp_example");
    auto result = profiler::dumpBlocksToFile((path +"/test_profile.prof").c_str());
    std::cout << "result " << result << std::endl;

}

#include <iostream>
#include <ros/ros.h>
#include <sensor_msgs/Image.h>
#include <opencv2/opencv.hpp>

void imageCallback(const sensor_msgs::Image& msg);

int main(int argc, char** argv)
{
    ros::init(argc, argv, "Main");
    ros::start();

    ros::NodeHandle nodeHandler;
    ros::Subscriber sub = nodeHandler.subscribe("/usb_cam/image_raw", 1, imageCallback);

    std::cout << "Hello ROS C++" << std::endl;

    ros::spin();
}

void imageCallback(const sensor_msgs::Image& msg)
{
    cv::Mat src = cv::Mat(msg.height, msg.width, CV_8UC3, const_cast<uint8_t*>(&msg.data[0]), msg.step);
    cv::cvtColor(src, src, cv::COLOR_RGB2BGR);
    cv::imshow("image", src);
    cv::waitKey(1);
}
